INSERT INTO `Marketplace_App` VALUES ('49946cad-74cb-008d-f5aa-31f785728fef',31384,20099,0,NULL,'2019-10-29 11:37:52.862000','2019-10-29 11:37:52.862000',103475381,'Liferay Adaptive Media','Liferay Adaptive Media 1.0.0 requires the installation of the Liferay Digital Enterprise 7.0 Fix Pack 35 or higher.The Adaptive Media app tailors media in your portal to the device consuming it. Since users often consume media on multiple devices that have different screen sizes and capabilities, you should make sure that your portal presents that media in a manner suitable for each device. For example, portal administrators can configure the Adaptive Media app to send high-res images to high-res devices, low-res images to low-res devices, and so on. This ensures that your users have the best possible experience when consuming media from your portal, regardless of the device they use.Note that at this time, the Adaptive Media app only works with images in Documents and Media, Blogs, and Web Content.Once installed, the Adaptive Media app appears in the Control Panel, under the Configuration menu.In Liferay 7.1, this app is installed by default and updated through Liferay DXP Fix Packs and Liferay Portal CE GA releases. Using Liferay Marketplace to update the app on Liferay 7.1 will cause an error.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158812804','2.0.10',0);
