INSERT INTO `Marketplace_App` VALUES ('d98a6786-b95e-32d1-8457-8b485c10850c',31468,20099,0,NULL,'2019-10-29 11:37:53.330000','2019-10-29 11:37:53.330000',106234517,'LIferay APIO Architect','LIferay','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158812769','1.0.10',1);
INSERT INTO `Marketplace_App` VALUES ('847fff7a-791c-242d-0b63-3ef02bb448b5',31475,20099,0,NULL,'2019-10-29 11:37:53.372000','2019-10-29 11:37:53.372000',109797281,'Liferay External Reference','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821915','1.0.7',1);
INSERT INTO `Marketplace_App` VALUES ('00623bb1-eb09-372d-8b91-f905c175c57b',31478,20099,0,NULL,'2019-10-29 11:37:53.391000','2019-10-29 11:37:53.391000',116778139,'Liferay Portal OData','Liferay Portal OData','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158824833','1.0.6',1);
INSERT INTO `Marketplace_App` VALUES ('1b6cd7cb-c9e2-cf8a-f291-3867ee731456',31481,20099,0,NULL,'2019-10-29 11:37:53.409000','2019-10-29 11:37:53.409000',108676377,'Liferay Product Navigation','Liferay Product Navigation','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821338','1.0.10',1);
INSERT INTO `Marketplace_App` VALUES ('bf695902-fa42-cfd0-a2be-98c6fe0c15ca',31498,20099,0,NULL,'2019-10-29 11:37:53.504000','2019-10-29 11:37:53.504000',116775839,'Liferay Hypermedia REST APIs','The Liferay Hypermedia REST APIs app exposes a new breed of RESTful hypermedia APIs that interact with Liferay services. These APIs let developers consume Liferay services in a straightforward and flexible way. For example, developers can consume portal resources like sites, blogs, pages, and users via fully RESTful APIs that support several response formats like plain JSON, JSON-LD, or HAL. What\'s more, these APIs are evolvable and can change over time with minimal risk to most clients that consume them.This app has no visual component in the portal. After installing it, you can begin accessing the APIs via the home URL http://[host]:[port]/o/api.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/166054633','1.0.0',0);
INSERT INTO `Marketplace_App` VALUES ('424ee44c-cbb0-7b64-d981-0a4835a59c4a',31545,20099,0,NULL,'2019-10-29 11:37:53.750000','2019-10-29 11:37:53.750000',108754826,'Liferay Portal Security','Liferay Portal Security','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821942','1.0.10',1);
