INSERT INTO `Marketplace_App` VALUES ('58bd3c40-508f-d9ed-0fca-c552cacd44d7',31568,20099,0,NULL,'2019-10-29 11:37:53.868000','2019-10-29 11:37:53.868000',106004266,'Liferay Connector to Elasticsearch 6','Liferay Connector to Elasticsearch 6 connects Liferay Portal or Liferay DXP to the Elasticsearch 6.1.x search engine. This client application is a drop-in replacement for the default Elasticsearch 2.x connector that ships with the Foundation app suite.Liferay Connector to Elasticsearch 6 1.0.1+ requires the installation of the Liferay Digital Enterprise 7.0 Fix Pack 70 or higher.In Liferay 7.1, this app is installed by default and updated through Liferay DXP Fix Packs and Liferay Portal CE GA releases. Using Liferay Marketplace to update the app on Liferay 7.1 will cause an error.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158812977','2.0.10',0);
INSERT INTO `Marketplace_App` VALUES ('b04c8527-2655-6ffc-eebe-5ae8fe2507a7',31573,20099,0,NULL,'2019-10-29 11:37:53.892000','2019-10-29 11:37:53.892000',108751470,'Liferay Changeset','Liferay Changeset','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158113250','1.0.9',1);
