INSERT INTO `Marketplace_App` VALUES ('73cc301c-9bfa-e074-142b-c118851ee1d0',31581,20099,0,NULL,'2019-10-29 11:37:53.930000','2019-10-29 11:37:53.930000',109797407,'Liferay Meris','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821707','1.0.6',1);
INSERT INTO `Marketplace_App` VALUES ('1142c0d1-6ab3-2334-4b64-5c8aa597bea4',31583,20099,0,NULL,'2019-10-29 11:37:53.942000','2019-10-29 11:37:53.942000',109571986,'Liferay Plugin for OAuth 2.0','OAuth 2.0 is an industry-standard authorization protocol. Users can seamlessly share select credentials from another website to log into yours. It works by authorizing password-less access to portions of user-owned resources (such as an email address, a user profile picture, or something else from your account) and other permissioned resources.','Security','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/166005159','1.1.0',0);
