INSERT INTO `Marketplace_App` VALUES ('dcf5a139-6862-d8a9-d7b3-237a02aa8548',31756,20099,0,NULL,'2019-10-29 11:37:54.938000','2019-10-29 11:37:54.938000',54369726,'Liferay Screens Compatibility','This plugin is a portlet that exposes additional classes and methods that are not present in Liferay\'s out-of-the-box API. These additional classes and methods allow Liferay Screens to do certain operations that are needed for the screenlets to work correctly.Please report issues with the Liferay Screens Compatibility Plugin by creating a ticket in https://issues.liferay.com/browse/LMW.Liferay Screens Compatibility 1.x is a Lab application and is not supported by Liferay.In Liferay 7.1, this app is installed by default and updated through Liferay DXP Fix Packs and Liferay Portal CE GA releases. Using Liferay Marketplace to update the app on Liferay 7.1 will cause an error.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158817275','4.0.9',0);
