INSERT INTO `Marketplace_App` VALUES ('c0fb36a2-b235-7e6b-95ee-a63f83be57d8',31772,20099,0,NULL,'2019-10-29 11:37:55.032000','2019-10-29 11:37:55.032000',124748272,'Liferay Bean Portlet','Bean Portlet provides CDI \"bean portlets\" capability. It lets you register portlets using annotations such as @PortletConfiguration and its @Inject annotation obtains dependencies via Contexts and Dependency Injection (CDI). Bean portlets are a feature of the Portlet 3.0 Specification as defined by JSR 362.The Bean Portlet modules install to LIFERAY_HOME/osgi/modules/static.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/124748276','1.0.1',0);
