INSERT INTO `Marketplace_App` VALUES ('40b1e5c2-627a-db26-d224-de6110cfa70c',31841,20099,0,NULL,'2019-10-29 11:37:55.392000','2019-10-29 11:37:55.392000',71774947,'Liferay Connected Services Client','The Liferay Connected Services app connects your Liferay instance to Liferay Connected Services (LCS). LCS is an online service that offers fix pack management, server metrics, Liferay subscription management, and more. LCS provides single-click download and install of fix packs, even across a cluster. The server metrics service provides information on how your Liferay instance is running. This includes data on pages, portlets, memory usage, JVM performance, and more. Note that the fix pack and subscription management features require an active Liferay subscription.In order to offer the best service possible, we store the following information about your servers on the LCS servers: patches installed on each server, portal.properties (except sensitive data), JVM metrics, portal and portlet metrics, cache and server metrics. Sensitive data is defined as any key-value pair containing usernames or passwords.This app will appear in your Control Panel once installed.Liferay Connected Services Client requires the installation of the Liferay Portal 6.2 EE SP15+. In OpenShift and dockerized environments, the minimum Java requirement for LCS Client 5.0.0 is JDK 1.8.0_191.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/123422813','5.0.0',0);
