INSERT INTO `Marketplace_App` VALUES ('1f26e50a-aa22-ca8c-f121-d5d2d5465931',31860,20099,0,NULL,'2019-10-29 11:37:55.480000','2019-10-29 11:37:55.480000',108676800,'Liferay Fragment','Liferay Fragment','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158828365','1.0.10',1);
INSERT INTO `Marketplace_App` VALUES ('276e93ba-f644-2fdc-9f16-b1a15922287b',31874,20099,0,NULL,'2019-12-04 10:49:16.237000','2019-12-04 10:49:16.237000',108777289,'Liferay Frontend Editor','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/108777294','1.0.0',1);
