INSERT INTO `Marketplace_App` VALUES ('29b81387-da6b-c637-4419-a11f07381f09',31987,20099,0,NULL,'2019-10-29 11:37:56.278000','2019-10-29 11:37:56.278000',31708940,'Liferay Calendar','Liferay\'s Calendar app allows users and organizations to create, track, share, and manage events. In addition, the Calendar app supports notifications, integration with Social Office, and staging. As a user, you can create as many calendars as you need. As an administrator, you are able to manage the scheduling of Calendar Resources such as rooms and projectors. All content from the old Calendar portlet is automatically imported into this new application.In Liferay 7.1, this app is installed by default and updated through Liferay DXP Fix Packs and Liferay Portal CE GA releases. Using Liferay Marketplace to update the app on Liferay 7.1 will cause an error.','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158817495','3.0.10',0);
