INSERT INTO `Marketplace_App` VALUES ('3fb00e45-0440-c1f8-9a9f-908742501cc8',32019,20099,0,NULL,'2019-10-29 11:37:56.563000','2019-10-29 11:37:56.563000',106226846,'Liferay Portal Workflow','Liferay','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158822043','1.0.10',1);
INSERT INTO `Marketplace_App` VALUES ('6bdaf5a3-d5ff-f8f9-6caf-b69f1bdc98b2',32038,20099,0,NULL,'2019-10-29 11:37:56.665000','2019-10-29 11:37:56.665000',110543924,'Liferay Invite Members','The Liferay Collaboration suite provides applications and features that help users share ideas, implement them, and produce terrific results. Its apps such as Message Boards and Blogs help users start discussions, ask questions, share ideas, and connect with other users. Wiki allows users to share in-depth information. And Alerts and Announcements facilitate broadcasting information and notifications.As users collaborate, they\'re sure to produce important files. The suite\'s Documents and Media Library allows users to store files, share them, and publish them. It not only works with Liferay\'s built-in repository but also allows you to integrate with external repositories, such CMIS repositories. Users can add and share all kinds of files, including documents, presentations, images, and videos. And the suite\'s Documents and Media app and Media Gallery help users display files the way they like them.As users engage in site activities, you\'ll want to recognize them and connect them with other users. The suite\'s social networking apps and features enable you to attribute social equity to active users automatically by increasing their rank on the site. You can even highlight user activities to show your site\'s liveliness. The Mentions feature facilitates notifying specific users in the context of site content, discussions, and comments. The social apps also help users share their thoughts on the your sites and other social sites, such as Facebook and Twitter. Combined with the suite\'s collaboration and document management features, the Collaboration suiteâs social features help develop awesome communities, foster high morale, and make work interesting.Apps and Features: Activities, Alerts, Announcements, Blogs, Bookmarks, Comments, Friends/My Sites/Portal/Site Members Directory, Documents and Media, Friend Requests, Image Uploader, Invite Members, Media Gallery, Message Boards, Mentions, Microblogs, Page Flags/Comments/Ratings, Quick Note, Requests, Social Activity, User/Group Statistics, Wiki.This suite may contain modules that depend on Foundation suite modules. This suite is available in the Liferay bundle.','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821618','1.0.9',1);
INSERT INTO `Marketplace_App` VALUES ('17d7c6a6-94c0-94a7-3d76-7a70097025d8',32042,20099,0,NULL,'2019-10-29 11:37:56.692000','2019-10-29 11:37:56.692000',74860500,'Liferay Static','The Static app contains an important group of extenders and utilities that Liferay statically installs before installing any dynamic OSGi modules. The app\'s functionality includes a log4j extender, an OSGi WAB extender, configuration utilities, OSGi deployment utilities, target platform indexing, and more.This suite is available in the Liferay bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158821393','7.1.10',1);
