INSERT INTO `Marketplace_App` VALUES ('dadeb839-0673-a1fb-f5a3-83fca21c9756',32211,20099,0,NULL,'2019-10-29 11:37:57.815000','2019-10-29 11:37:57.815000',108752038,'Liferay Imageio Plugins','Liferay Imageio Plugins','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158817352','1.0.7',1);
INSERT INTO `Marketplace_App` VALUES ('2401c583-335a-d978-22fc-5308ace9bed4',32218,20099,0,NULL,'2019-10-29 11:37:57.899000','2019-10-29 11:37:57.899000',15100561,'Liferay Knowledge Base','Liferay Knowledge Base 3.0.1 requires the installation of the Liferay Digital Enterprise 7.0 Fix Pack 33 or higher.Liferay\'s Knowledge Base app provides a means for creating and organizing articles within a site. The knowledge base is perfect for creating and organizing information more formally than in a wiki. For example, it can be used to organize and display professional product documentation. The knowledge base lets you import article source files written in Markdown, so you can work on them offline before publishing. Its integration with GitHub allows you to give users access to contribute fixes or improvements to articles. It\'s easy to set up the knowledge base with a workflow that requires articles to be approved before they are published. Additionally, it allows administrators to create article templates. Templates can be used to ensure that certain kinds of articles possess a common structure and include certain kinds of information. Knowledge base articles can be categorized to make them easy to find. They can also be organized hierarchically to form complete books or guides. There are multiple portlets included in this app.This app will appear in your Application menu and Site Administration once installed.','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/158812459','4.0.10',0);
